function f_gold(s) {
    let n = s.length;
    let ans = '';
    for (let i = 0; i < n; i++) {
        let lower = 0, upper = 0;
        for (let j = i; j < n; j++) {
            if (s[j].toLowerCase() === s[j]) {
                lower |= 1 << (s[j].charCodeAt(0) - 'a'.charCodeAt(0));
            } else {
                upper |= 1 << (s[j].charCodeAt(0) - 'A'.charCodeAt(0));
            }
            if (lower === upper && j - i + 1 > ans.length) {
                ans = s.substring(i, j + 1);
            }
        }
    }
    return ans;
}
